create table users
(
    id                                                     bigserial,
    name                                                   varchar(191),
    email                                                  varchar(191),
    email_verified_at                                      timestamp,
    password                                               varchar(255),
    token                                                  varchar(191),
    remember_token                                         varchar(100),
    created_at                                             timestamp,
    updated_at                                             timestamp,
    slug                                                   varchar(191),
    bio                                                    text,
    recommended_by_svd                                     text,
    recommended_by_user_keywords                           text,
    recommended_by_best_rated_by_others_in_user_categories text,
    recommended_by_hybrid                                  text
);

alter table users
    owner to postgres;

